import React from 'react'
import s from  '../../styles/styles.module.css'
import styled from 'styled-components'
import { makeStyles } from '@material-ui/styles'
import { 
    Box, Grid, Card,
    CardActionArea,
    CardMedia,
    CardContent,
    Typography,
    CardActions,
    Button }     from '@material-ui/core'

const useStyles = makeStyles(theme => ({
    root: {
      margin: theme.spacing(3),
      width: 345,
    },
    media: {
      height: 140,
    },
    title: {
      color: theme.palette.primary.main
    }
  }))

class Hero extends React.Component {
    constructor(props) {
        super(props);
        this.state = {

        }
        const classes = useStyles()
    }

    render() {
        return (
            <div>
                <Box>
                    <Grid container alignItems="center" justify="center">
                        <Grid item md={8}>
                        <Card className={classes.root}>
                        <CardActionArea>
  <CardMedia
    className={classes.media}
    image="https://images.unsplash.com/photo-1540573133985-87b6da6d54a9?ixlib=rb-1.2.1&auto=format&fit=crop&w=1955&q=80"
    title="Surprised monkey"
  />
  <CardContent>
  <Typography gutterBottom variant="h5" component="h2" className={classes.title}>
  OMG it's a Monkey!
</Typography>
<Typography variant="body2" color="textSecondary" component="p">
  Monkey is a common name that may refer to groups or species of mammal. The term is applied descriptively to groups of primates
</Typography>
  </CardContent>
  <CardActions>
  <Button size="small" color="primary" href="https://unsplash.com/photos/Z05GiksmqYU">
    See it on Unsplash
  </Button>
</CardActions>
</CardActionArea>
</Card>
                        </Grid>
                    </Grid>
                </Box>
            </div>
        )
    }
}

export default Hero
